import React from "react";


function Header(){
    const header = {
        backgroundCcolor: "#f5ba13",
        margin: "auto -16px",
        padding: "16px 32px",
        boxShadow: "0 0 10px 0 rgba(0, 0, 0, 0.3)",
      }
      
      const headerh1 = {
        color: "#fff",
        fontFamily: "McLaren, cursive",
        fontWeight: "200"
      }



   return(
       <header>
            <h1 style ={header,headerh1}>Keeper App</h1>
       </header>
   ) 
}

export default Header;
